import axios from 'axios';
import {useState} from 'react';

function DisplaySimpson(){
const [simpon,setSimpson] =useState()
axios
      .get('https://simpsons-quotes-api.herokuapp.com/quotes?count=num')
      .then((res) => {
        console.log(res);
        this.setState({ simpsons: res.data });
      });



    return (
      <ul>
        {this.state.simpsons.map((simpson) => (
          <li>{simpson.character}</li>
        ))}
      </ul>
    );



}
